import * as React from "react";
import Box from "@mui/material/Box";

function BoxSx() {

    return(
        <div className="box">
            <Box clone style={{color:'white'}} m={3}> 
            <h1>Anurag Chaursia</h1>
            </Box>
        </div>
    )
}
    
export default BoxSx;
